/*Data for the table `tipo_indicador` */

insert  into `tipo_indicador`(`tipo_indicador_id`,`tipo_indicador_nombre`,`tipo_indicador_abrev`,`tipo_indicador_activador`,`tipo_indicador_calculo`,`tipo_indicador_definicion`,`tipo_indicador_html`) values (1,'Balanza comercial Relativa ','BCt','precio','BCt= (Xij-Mij) / (Xij+Mij), \r\nDonde Xij = Exportaciones de un producto i por un pa铆s j,\r\nMij = Importaciones de un producto i a un pa铆s j.\r\n','Mide la relaci贸n entre la balanza comercial neta y flujo total de comercio de un producto determinado.\r\n\r\n.','<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-10 col-md-9 col-sm-6 col-xs-3\">\r\n <h1 class=\"page-header\">Balanza comercial Relativa </h1>\r\n\r\n  <p class=\"alert alert-success alert-dismissable\">\r\n	Mide la relaci贸n entre la balanza comercial neta y flujo total de comercio \r\n        de un producto determinado.</p>\r\n  <hr>\r\n  	\r\n  <p class=\"lead\">BCt = (Xij - Mij) / (Xij + Mij)</p>\r\n  <p>Donde:</p>\r\n    <ul>\r\n      <li>Xij = Exportaciones de un producto i por un pa铆s j</li>\r\n      <li>Mij = Importaciones de un producto i a un pa铆s j</li>\r\n  	</ul>\r\n  <h4>Pertinencia</h4>\r\n  <p>\r\nEs 煤til para calcular el balance comercial neto entre dos pa铆ses respecto al mismo sector o producto.\r\n</p>\r\n\r\n</div>\r\n</div>\r\n</div>'),(2,'Balanza comercial','BC','precio','BC= ( Xij - Mij)\r\nDonde Xij = Exportaciones de un producto i por un pa铆s j,\r\nMij = Importaciones de un producto i a un pa铆s j.\r\n','La balanza comercial es la diferencia que existe entre el total de las exportaciones menos el total de las importaciones de un pa铆s. \r\n','<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-10 col-md-9 col-sm-6 col-xs-3\">\r\n<h1 class=\"page-header\">Balanza comercial </h1>\r\n\r\n  <p class=\"alert alert-success alert-dismissable\">\r\nLa balanza comercial es la diferencia que existe entre el total de las exportaciones menos el total de las importaciones de un pa铆s. \r\n</p>\r\n  <hr>\r\n  	\r\n  <p class=\"lead\">BC =  ( Xij - Mij ) </p>\r\n  <p>Donde:</p>\r\n  <ul>\r\n    <li>Xij = Exportaciones de un producto i por un pa铆s j</li>\r\n    <li>Mij = Importaciones de un producto i a un pa铆s j</li>\r\n  </ul>\r\n  <hr>\r\n  <h4>Pertinencia</h4>\r\n  <p>\r\nEs 煤til para calcular el balance comercial neto entre dos pa铆ses respecto al mismo sector o producto.\r\n</p>\r\n  \r\n</div>\r\n</div>\r\n</div>'),(3,'Variaci贸n de la Balanza Comercial','%BCt','precio','%BCt= (Xijt-Mijtp2) - (Xijt-Mijt-p1) /(Xijt-Mijt-p1)\r\nDonde Xijt = Exportaciones de un producto i por un pa铆s j en un periodo t+1, \r\nMij = Importaciones de un producto i a un pa铆s j en un periodo t.','Se define como indicador para establecer el crecimiento o decrecimiento del la balanza comercial antes y despu茅s de la firma de un TLC o en cualquier periodo de tiempo.','<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-10 col-md-9 col-sm-6 col-xs-3\">\r\n<h1 class=\"page-header\">\r\n  Variaci贸n de la Balanza Comercial <small>Agropecuaria y Agroindustrial</small>\r\n</h1>\r\n\r\n  <p class=\"alert alert-success alert-dismissable\">\r\n    Se define como indicador para establecer el crecimiento o decrecimiento del la balanza comercial antes y despu茅s de la firma de un TLC o en cualquier periodo de tiempo.\r\n  </p>\r\n  <hr>\r\n  	\r\n  <p class=\"lead\">\r\n    %BCt = (Xijt-Mijtp2) - (Xijt-Mijt-p1) / (Xijt-Mijt-p1)\r\n  </p>\r\n  <p>Donde:</p>\r\n  <ul>\r\n    <li>Xijt = Exportaciones de un producto i por un pa铆s j en un periodo t+1</li>\r\n    <li>Mij = Importaciones de un producto i a un pa铆s j en un periodo t</li>\r\n  </ul>\r\n  <hr>\r\n  <h4>Pertinencia</h4>\r\n  <p>\r\n    Identificar el comportamiento de la balanza comercial antes y despu茅s de la firma de un TLC o en un periodo cualquiera.\r\n  </p>\r\n</div>  \r\n</div>\r\n</div>'),(4,'Concentraci贸n de la Oferta Exportable  Agropecuaria y Agroindustrial de Colombia por Socio comercial','Oferta Exp','precio','N煤mero